import '../res/style/App.css';
import ContactForm from "../components/contact/ContactForm";
import ResumeForm from "../components/contact/ResumeForm";

const Contact = () => {
    return (
        <div className="Body">
            <h1>Send a Message</h1>
            <ContactForm />
            <h1>Request Resume</h1>
            <p>If you'd like a copy of my resume, please use this form and I will send you a copy as soon as possible. </p>
            <ResumeForm />
        </div>
    );
}

export default Contact;
